import SideNav from "./Components/Try/SideNav";
import TopNav from "./Components/Try/TopNav";
function App() {
  return (
    <BrowserRouter>
    <Routes>
      <Route path="/" element={< SideNav/>} /> 
      <Route index element={<SideNav/>} />
     <Route path="/hellow" element={<TopNav/>}>
     <Route path="/" element={< SideNav/>} /> 

     </Route>
      {/* <Route path="/applicant" element={< Applicant/>} />  */}
      {/* <Route path="/organization" element={< Organization/>} />  */}



    </Routes>
  </BrowserRouter>

  );
}

export default App;
